import './store.css';
import ItemDetail from './itemDetail.js';

export default function Tile(props) {

  return (
      <div className="tile">
        <img className="image" src={props.image}></img>
        <div className="info"> 
          <div className="text">{props.text}</div>
          <div className="price">{props.price}</div>
        </div>
      </div>
  );
}
